import { createAsyncThunk, createSlice } from '@reduxjs/toolkit'
import axios from 'axios'

const initialState = {
  user: {

  }
}

export const getUser = createAsyncThunk(
  async () => {
    try {
      const res = await axios({
        method: 'get',
        url: 'http://localhost:5000/authorize'
      }).data.user
      return res
    } catch (error) {}
  }
)

const userSlice = createSlice({
  name: 'user',
  initialState,
  reducers: {

  }
})

